package com.juxingtech.helmet.bean;

import io.swagger.annotations.ApiModel;
import io.swagger.annotations.ApiModelProperty;
import lombok.Data;

/**
 * @author haoxr
 * @date 2020-07-03
 **/

@ApiModel
@Data
public class LicensePlateReq {

    @ApiModelProperty(value = "设备ID", example = "13030421191190201061", required = true)
    private String deviceId;

    @ApiModelProperty(value = "车牌图片(base64编码格式)", example = "", required = true)
    private String image;

    @ApiModelProperty(value = "车牌颜色", example = "蓝", required = true)
    private String plateColor;

    @ApiModelProperty(value = "车牌号", example = "沪A88888", required = true)
    private String plateNo;
}
